import React from "react";
import "./Sidebar.css";
import image from "../../DummyData/images/profile-1.jpg";
// import image2 from "../../DummyData/images/profile-2.jpg";

function Sidebar({ elements }) {
  // const [active, setActive] = useState();
  return (
    <div>
      <main className="main">
        <div className="container">
          <div className="left">
            <a href="/#" className="profile">
              <div className="profile-photo">
                <img src={image} alt="" />
              </div>
              <div className="handle">
                <h4>Muhammed Rashin</h4>
                <p className="text-muted">@rash</p>
              </div>
            </a>

            <div className="sidebar">
              {elements.map((element) => (
                <a href="/#" className="menu-item active">
                  <span>

                    {element.count?null : <i className={element.icon} /> } 
                    {/* <i className={element.icon}>
                      <small className="notification-count">9+</small>
                    </i> */}
                  </span>
                  <h3>{element.text}</h3>
                </a>
              ))}
            </div>

            <label htmlFor="create-post" className="btn btn-primary">
              Create
            </label>
          </div>
        </div>
      </main>
    </div>
  );
}

export default Sidebar;
